Removes consecutive repeated elements in the vector according to the
[`PartialEq`] trait implementation.

If the vector is sorted, this removes all duplicates.

# Examples

```
let mut vec = vec![1, 2, 2, 3, 2];

vec.dedup();

assert_eq!(vec, [1, 2, 3, 2]);
```
